import React from "react";

import "./Window.css";

const Window = (props) => {
  const image = require(imagePath="/src/data/vortex/ground-truth/save-timestep-3-iso--0.100000-theta-45.000000-phi-90.000000.png");

  return (
    <div className="image-window">
      <img src={image.default} alt='not found'/>
    </div>
  );
};

export default Window;
